import React from "react";
import './Skillset_page_left.css';
import brush from './brush_pic.png';
import Bluecoding from './coding_icon_blue.png';
import responsive from './responsive_icon.png';

function Skillset_page_left () {
    return(
        <div className="Main-Skillset_page_left">
            <div><h2>Design + Development</h2><p style={{marginBottom : "20px"}}><img src={brush} width={"10%"}/>Clean, modern designs - optimized for performance and converting users to costumers</p></div>
            <div><img src={Bluecoding} width={"10%"}/></div>
            <div><img src={responsive} width={"10%"}/></div>
        </div>
    );
}

export default Skillset_page_left;
